import { FC } from "React";
import styled from "styled-components";
import contract from "../../media/icons/contract.png"

const ExpandedMenuContet = styled.div`
  position: absolute;
  height: 500px;
  background-color: red;
  margin-top: 10px;
`;

const MenuItem = styled.div`
  margin-top: 5px;
`;
const Icon = styled.img`
  margin-left: 10px;
  padding-right: 10px;
`;
const PublicationsIcon = styled.img`
  margin-left: 13px;
  padding-right: 10px;
`;
const Label = styled.label`
  font-size: 80%;
  color:gray;
`;
const MenuLabel = styled.div`
  margin-bottom: 10px;
  margin-left: 10px;
`;
const IconContract = styled.img`
  margin-left: 13px;
  padding-right: 5px;
  width:22px;
`;
export const ExpandedMenu: FC = () => {
  return (
    <ExpandedMenuContet>
      <MenuItem>
        <MenuLabel>
          <Label>Platform</Label>
        </MenuLabel>
        <Icon src="./media/icons/house.png" alt="" />
        Home
      </MenuItem>
      <MenuItem>
        <PublicationsIcon src="./media/icons/Publications.png" alt="" />
        Publications
      </MenuItem>
      <MenuItem>
        <Icon src="./media/icons/people.png" alt="" />
        People
      </MenuItem>
      <MenuItem>
        <Icon src="./media/icons/entities.png" alt="" />
        Entities
      </MenuItem>
      <MenuItem>
        <Icon src="./media/icons/administration.png" alt="" />
        Administration
      </MenuItem>
      <MenuLabel>
          <Label>Platform</Label>
        </MenuLabel>
        <MenuItem>
        <IconContract src={contract} alt="" />
        Client contract
      </MenuItem>
      <MenuItem>
        <IconContract src={contract} alt="" />
       Supplier contract
      </MenuItem>
      <MenuItem>
        <Icon src="../../media/icons/entities.png" alt="" />
       Corporate
      </MenuItem>
    </ExpandedMenuContet>
  );
};
